import React,{useState} from 'react'
import './login.css';
import { Link } from 'react-router-dom';
import axios from 'axios';

const Login = () => {

    const [username,setUsername] = useState('')
    const [password,setPassword] = useState('')
    const loginHandler = (event) => {

        axios.post('http://127.0.0.1:8000/api/accounts/token',{

        username:username,
        password:password,
        })
    }
    return (
        <div className="login">
            <span className="loginTitle">Login</span>
            <form action="" className="loginForm">
                <label>
                    Username
                </label>
                <input type="text" value={username} onChange={ (e) => {e.taget.value}} placeholder="enter your username..." />
                <label>
                    Password
                </label>
                <input type="password"  placeholder="enter password" />
                <button className="loginButton"> <Link className="link" onClick={loginHandler} to="/login">Login</Link></button>
                <button className="loginRegisterButton"> <Link className="link" to="/register">Register</Link></button>
               

            </form>
        </div>
    )
}

export default Login;
